import logo from './logo.svg';
import './App.css';
// import axios from 'axios';
import { useState } from 'react';
// import { Input, Label } from 'react-bootstrap';



function App() {
  const [employee, setEmployee] = useState({
    employee_name: "",
    employee_surname: "",
    employee_birthday: "",
    employee_birthplace: "",
    city_id: "",
    district_id: "",
    address_type_id: "",

  })






  return (
    <div className='container'>
      <div className='row'>
        <div className='col-lg-6'>
          <div className="form-group">
            <label htmlFor="username"><h4>Enter name</h4></label>
            <input id="username" name="username" type="text" />
          </div>
          <div className="form-group">
            <label htmlFor="surname"><h4>Enter surname</h4></label>
            <input id="surname" name="surname" type="text" />
          </div>
          <div className="form-group">
            <label htmlFor="birthdate"><h4>Enter your birth date</h4></label>
            <input id="birthdate" type="date" name="birthdate" />
          </div>
          <div className="form-group">
            <label htmlFor="birthplace"><h4>Enter your birthplace</h4></label>
            <input name="birthplace" type="text" />
          </div>
          <button>Save</button>
        </div>
      </div>
    </div>//Container



  );
}

export default App;
